export default function Main() {

  return (
    <main
      className="main"
      style={{
        width: '80vh',
        height: '80vh',
        marginTop: '50px',
        backgroundColor: '',
        borderRadius: '10px',
        display: 'grid',
        gridTemplateRows: 'auto auto',
        gridTemplateColumns: 'auto auto'
      }}
    >
        <Die value="1" />
        <Die value="1" />
        <Die value="1" />
        <Die value="1" />
